"   <div class=\"block pha drugH1Div\" id=\"F155101\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Coenzyme for various metabolic functions, including fat and carbohydrate metabolism and protein synthesis, used in cell replication and hematopoiesis",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F155119\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Oral: Variable from the terminal ileum; requires the presence of calcium and gastric &ldquo;intrinsic factor&rdquo; to transfer the compound across the intestinal mucosa",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Principally stored in the liver and bone marrow, also stored in the kidneys and adrenals",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: Transcobalamins",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Converted in tissues to active coenzymes, methylcobalamin and deoxyadenosylcobalamin; undergoes some enterohepatic recycling",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Intranasal solution: Nascobal&reg;: 6.1% (relative to I.M.)",
"    </p>",
"   </div>",
"  </div>",
