"       www.alphaone.org",
"      </a>",
"      (Accessed on May 11, 2010).",
"     </li>",
"    </ul>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"PATIENT_INFORMATION\">",
"    <span class=\"h1\">",
"     INFORMATION FOR PATIENTS",
"    </span>",
"    &nbsp;&mdash;&nbsp;UpToDate offers two types of patient education materials, &ldquo;The Basics&rdquo; and &ldquo;Beyond the Basics.&rdquo; The Basics patient education pieces are written in plain language, at the 5",
"    <sup>",
"     th",
"    </sup>",
"    to 6",
"    <sup>",
"     th",
"    </sup>",
"    grade reading level, and they answer the four or five key questions a patient might have about a given condition. These articles are best for patients who want a general overview and who prefer short, easy-to-read materials. Beyond the Basics patient education pieces are longer, more sophisticated, and more detailed. These articles are written at the 10",
"    <sup>",
"     th",
"    </sup>",
"    to 12",
"    <sup>",
"     th",
"    </sup>",
"    grade reading level and are best for patients who want in-depth information and are comfortable with some medical jargon.",
"   </p>",
"   <p>",
"    Here are the patient education articles that are relevant to this topic. We encourage you to print or e-mail these topics to your patients. (You can also locate patient education articles on a variety of subjects by searching on &ldquo;patient info&rdquo; and the keyword(s) of interest.)",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      Beyond the Basics topics (see",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?32/22/33122?source=see_link\">",
"       \"Patient information: Supplemental oxygen on commercial airlines (Beyond the Basics)\"",
"      </a>",
"      )",
"     </li>",
"    </ul>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H20\">",
"    <span class=\"h1\">",
"     SUMMARY AND RECOMMENDATIONS",
"    </span>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      Despite pressurization of airliner cabins, flying at a high altitude can induce significant hypoxemia in patients with underlying lung disease. Patients who are at risk of becoming hypoxemic are candidates for supplemental oxygen during the flight. (See",
"      <a class=\"local\" href=\"#H2\">",
"       'Effects of air travel'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Initial screening is performed by assessing pulse oxygen saturation (SpO",
"      <sub>",
"       2",
"      </sub>",
"      ) while the patient is at rest and breathing room air (",
"      <a class=\"graphic graphic_table graphicRef57963 \" href=\"UTD.htm?36/33/37403\">",
"       table 2",
"      </a>",
"      ). Patients who have a SpO",
"      <sub>",
"       2",
"      </sub>",
"      of 95 or higher at sea level are unlikely to have significant hypoxemia during air travel and generally do not need further testing.",
"     </li>",
"     <li>",
"      For patients with a SpO",
"      <sub>",
"       2",
"      </sub>",
"      &lt;92 percent at sea level, we suggest use of supplemental oxygen in-flight (",
"      <a class=\"grade\" href=\"._grade_5?title=Grade 2B\">",
"       Grade 2B",
"      </a>",
"      ). (See",
"      <a class=\"local\" href=\"#H5\">",
"       'Screening for in-flight hypoxemia'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Patients who have a resting SpO",
"      <sub>",
"       2",
"      </sub>",
"      between 92 and 95 percent at sea level and no risk factors for in-flight hypoxemia generally do not need further testing (",
"      <a class=\"graphic graphic_table graphicRef57963 \" href=\"UTD.htm?36/33/37403\">",
"       table 2",
"      </a>",
"      ). (See",
"      <a class=\"local\" href=\"#H7\">",
"       'Indications for further evaluation'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Patients who have a resting SpO",
"      <sub>",
"       2",
"      </sub>",
"      between 92 and 95 percent at sea level AND a risk factor for in-flight hypoxemia are candidates for further assessment to predict their likely in-flight PaO",
"      <sub>",
"       2",
"      </sub>",
"      (",
"      <a class=\"graphic graphic_table graphicRef57963 \" href=\"UTD.htm?36/33/37403\">",
"       table 2",
"      </a>",
"      ). For these patients, the preferred method for assessing the need for in-flight supplemental oxygen is high altitude simulation testing (HAST), when available. (See",
"      <a class=\"local\" href=\"#H7\">",
"       'Indications for further evaluation'",
"      </a>",
"      above and",
"      <a class=\"local\" href=\"#H9\">",
"       'Hypoxia altitude simulation test'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      The HAST involves monitoring pulse oximetry and arterial blood gases during inhalation of a mixture of nitrogen and oxygen at a concentration of 15.1 percent oxygen for 20 minutes (",
"      <a class=\"graphic graphic_table graphicRef54344 \" href=\"UTD.htm?22/63/23547\">",
"       table 4",
"      </a>",
"      ). (See",
"      <a class=\"local\" href=\"#H9\">",
"       'Hypoxia altitude simulation test'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      If HAST testing is not available, a regression equation, using results from spirometry, diffusion capacity,",
"      <span class=\"nowrap\">",
"       and/or",
"      </span>",
"      arterial blood gases, may help predict which patients need supplemental oxygen during air travel. However, the regression equations tend to overestimate the need for in-flight supplemental oxygen. (See",
"      <a class=\"local\" href=\"#H8\">",
"       'Regression equations'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      For patients who are predicted to require supplemental oxygen during air travel, the preferred method to determine the actual flow rate requirements is to use hypoxic gas inhalation, such as that used for the high altitude simulation test (HAST). If such testing is not available, we suggest using an oxygen flow rate of 2",
"      <span class=\"nowrap\">",
"       L/minute",
"      </span>",
"      (",
"      <a class=\"grade\" href=\"._grade_5?title=Grade 2B\">",
"       Grade 2B",
"      </a>",
"      ). (See",
"      <a class=\"local\" href=\"#H16\">",
"       'Determining the oxygen requirement'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      For patients who require long-term supplemental oxygen at baseline, we suggest using an increased liter flow during air travel (",
"      <a class=\"grade\" href=\"._grade_6?title=Grade 2C\">",
"       Grade 2C",
"      </a>",
"      ). The predicted liter flow requirements may be determined by direct measurement during a HAST, as described above. An alternative is to increase the oxygen flow 1 to 2",
"      <span class=\"nowrap\">",
"       L/minute",
"      </span>",
"      over baseline while in flight. (See",
"      <a class=\"local\" href=\"#H16\">",
"       'Determining the oxygen requirement'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Supplemental oxygen may be derived from approved portable oxygen canisters or oxygen concentrators. Airlines landing in the United States are now required to allow use of portable oxygen concentrators throughout the flight. However, a prescription is needed from the clinician (",
"      <a class=\"graphic graphic_figure graphicRef71862 \" href=\"UTD.htm?9/40/9856\">",
"       figure 2",
"      </a>",
"      ) and prior approval is needed from the airline. (See",
"      <a class=\"local\" href=\"#H17\">",
"       'Practical considerations'",
"      </a>",
"      above.)",
"     </li>",
"    </ul>",
"   </p>",
