"   <div class=\"ttl\">",
"    Cutaneous findings of Stevens Johnson syndrome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 379px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Note the vesicles and bulla that are characteristic of the cutaneous findings in Stevens Johnson syndrome.",
"    <div class=\"footnotes\">",
"    </div>",
